description:
Verenigde Staten
Horror / Thriller
90 minuten

een goeie film

met Josh Stewart, Madeline Zima en Robert Wisdom

Ex-oplichter Arkin (Josh Stewart) is wanhopig op zoek naar geld om zijn vrouw af te betalen, zodat ze de stad niet verlaat met 
hun dochter. Als hij inbreekt in het huis op het platteland van zijn rijke baas, komt hij erachter dat de familie wordt 
vastgehouden door een gemaskerde moordenaar, die het huis vol boobytraps heeft gezet.
